// About.jsx
import React from "react";
import "./About.css";

const About = () => {
  return (
    <section id="about" className="about">
      <h2>About WR Resto</h2>
      <p>
        WR Resto is dedicated to serving the best meals with fresh ingredients.
        Our mission is to bring you happiness through delicious food and
        excellent service.
      </p>
      <img src="./assets/images/restaurant.jpg" alt="Our Restaurant" />
    </section>
  );
};

export default About;
